import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import Contact from './pages/Contact/index';
import HomePage from './pages/HomePage/index';
import Industries from './pages/Industries/index';
import OurTeam from './pages/OurTeam/index';
import WhyChooseUs from './pages/WhyChooseUs/index';
import Works from './pages/Works/index';
import { FormProvider } from './context/FormContext';
import { PageProvider } from './context/PageContext';
import NotFound from './components/UI/NotFound';
import ManageNav from './components/ManageNav';
// const dataNameList = ['services', 'partners', 'industries', 'leaders', 'reasons', 'benefits', 'projects', 'recents', 'proprietary', 'slideShows'];
function App() {
  return (
    <PageProvider>
      <FormProvider>
        <BrowserRouter>
          <Header />
          <Routes>
            <Route exact path="/" element={<HomePage />} />
            <Route exact path="/contact" element={<Contact />} />
            <Route exact path="/whychooseus" element={<WhyChooseUs />} />
            <Route exact path="/ourteam" element={<OurTeam />} />
            <Route exact path="/industries" element={<Industries />} />
            <Route exact path="/works" element={<Works />} />
          </Routes>
          <Routes>
            <Route exact path="/manage" element={<div><ManageNav /> MANAGE DATA PAGE </div>} />
            <Route exact path="/manage/services" element={<div><ManageNav />services</div>} />
            <Route exact path="/manage/partners" element={<div><ManageNav />partners</div>} />
            <Route exact path="/manage/industries" element={<div><ManageNav />industries</div>} />
            <Route exact path="/manage/leaders" element={<div><ManageNav />leaders</div>} />
            <Route exact path="/manage/reasons" element={<div><ManageNav />reasons</div>} />
            <Route exact path="/manage/benefits" element={<div><ManageNav />benefits</div>} />
            <Route exact path="/manage/projects" element={<div><ManageNav />projects</div>} />
            <Route exact path="/manage/recents" element={<div><ManageNav />recents</div>} />
            <Route exact path="/manage/proprietarys" element={<div><ManageNav />proprietarys</div>} />
            <Route exact path="/manage/slideShows" element={<div><ManageNav />slideShows</div>} />
            <Route path="*" element={<NotFound />} />
          </Routes>
          <Footer />
        </BrowserRouter>
      </FormProvider>
    </PageProvider>
  );
}

export default App;
